    public pageIndex = 2;
    public data: any[] = [];
    public searchTextValue = '';

    public subLayers = [];

    ngOnInit() {
        const input = this.input2.replace(/\n/g, "\\n")
        const artboards = JSON.parse(input).artboards;
        artboards.forEach(artboard => {
            this.data.push(new ArtboardToCode(artboard));
        })

        console.log(this.data);

        console.log(artboards[this.pageIndex].layers.find(item => item.content == "添加"));
    }

    public _$showLayersData(layer) {
        console.log(layer);
        console.log(layer.name.match(/plx:\d{2}-(.*?)\//)[1].replace(/[^a-zA-Z]/g, ''));
        this.subLayers = this.findChildren(layer, this.data[this.pageIndex].layers)
        console.log(this.subLayers)
    }

    public findChildren(target, layers) {
        return layers.filter(
            (layer) => layer !== target && this.isInclude(target, layer)
        );
    }

    // Delete used layers.
    public deleteChildren(target, layers) {
        return layers.filter((layer) => !this.isInclude(target, layer));
    }

    // Define whether layer1 cover layer2 or not
    public isInclude(layer1, layer2) {
        const x11 = layer1.rect.x;
        const x12 = layer1.rect.x + layer1.rect.width;
        const y11 = layer1.rect.y;
        const y12 = layer1.rect.y + layer1.rect.height;
        const x21 = layer2.rect.x;
        const x22 = layer2.rect.x + layer2.rect.width;
        const y21 = layer2.rect.y;
        const y22 = layer2.rect.y + layer2.rect.height;
        return (
            x21 >= x11 &&
            x21 <= x12 &&
            y21 >= y11 &&
            y21 <= y12 &&
            x22 >= x11 &&
            x22 <= x12 &&
            y22 >= y11 &&
            y22 <= y12
        );
    }

    public searchText() {
        const result = this.data[this.pageIndex].layers.filter(item => {
            return item.content == this.searchTextValue;
        })
        console.log(result);
    }
